import UserButton from "./UserButton";
import { Table } from "govuk-react";

const UserChoice = () => {
  return (
    <>
      <main
        className="govuk-main-wrapper app-main-class"
        id="main-content"
        role="main"
      >
        <Table
          caption="Custom widths"
          head={
            <Table.Row>
              <CellHeader setWidth="one-half">one-half</CellHeader>
              <CellHeader setWidth="22%">22%</CellHeader>
              <CellHeader>Normal</CellHeader>
            </Table.Row>
          }
        >
          <Table.Row>
            <Table.Cell>Column uses setWidth="one-half" in header</Table.Cell>
            <Table.Cell>setWidth="22%"</Table.Cell>
            <Table.Cell>Not specified</Table.Cell>
          </Table.Row>
        </Table>
      </main>
    </>
  );
};

export default UserChoice;
